    private EMccMncValue(int value, String name) {
        super(value, name);
    }

    public static EMccMncValue fromValue(int value) {
        return fromValueGeneric(EMccMncValue.class, value, unknownValue(value));
    }

    public static EMccMncValue unknownValue(int value) {
        return new EMccMncValue(value, "Unknown");
    }

    public int getMNC() {
        return value % 100;
    }

    public String toString() {
        return name + " (" + Utils.padLeft(Integer.toString(getMNC()), 3, '0') + ")";
    }

    public boolean isLongMnc() {
        return value > 99999;
    }
